import React from "react";
import "./App.css";

interface Props { }

// [[{}]] 1 tile

const chessArray = [
  [[], [], [], [], [], [], [], []],
  [[], [], [], [], [], [], [], []],
  [[], [], [], [], [], [], [], []],
  [[], [], [], [], [], [], [], []],
  [[], [], [], [], [], [], [], []],
  [[], [], [], [], [], [], [], []],
  [[], [], [], [], [], [], [], []],
  [[], [], [], [], [], [], [], []]
]

// const chessArray = [
//   [0, 1, 2, 3, 4, 5],
// ]

export default (props: Props) => {

  const renderTile = () => {
    return <React.Fragment>
      <div className="tile">
        <p>P</p>
      </div>
    </React.Fragment>
  }

  return <React.Fragment>
    <div className="container">
      {chessArray.map(c => (
        <React.Fragment>
          {c.map(renderTile)}
        </React.Fragment>
      ))}
    </div>
  </React.Fragment>;
};
